import React, { useState } from 'react'
import Button from 'react-bootstrap/Button'

function YButton(props) {
  if (props.shape === 'round')
    return (
      <div
        className={`roundBtnWrapper ${
          props.margin ? `${props.margin}` : 'mx-auto mt-4'
        }`}
      >
        <Button onClick={props.onclick} type={props.type} className='roundBtn'>
          {props.text}
        </Button>
      </div>
    )
  else if (props.shape === 'square')
    return (
      <div
        className={`squareBtnWrapper ${
          props.margin ? `${props.margin}` : 'mx-auto  mt-4'
        } ${props.btnClicked && !props.searching && 'YButtonWrapperClicked'}`}
      >
        <Button
          onClick={props.onclick}
          type={props.type}
          className={`squareBtn ${
            props.btnClicked && !props.searching && 'YButtonClicked'
          }`}
        >
          {props.text}
        </Button>
      </div>
    )
  else if (props.shape === 'google')
    return (
      <div className='squareBtnWrapper mx-auto mt-4'>
        <Button
          onClick={props.onclick}
          type={props.type}
          href={props.href}
          className='squareBtn google'
        >
          {props.img && <img src={props.img} />}
          {props.text}
        </Button>
      </div>
    )
  else return null
}

export default YButton
